	}

	.SearchBar_SearchBar_searchIcon__I9wXL {
		position: absolute;
		top: 26px;
		left: 20px;
		-webkit-transform: translateY(-50%);
		transform: translateY(-50%);
		color: #939393;
		width: 18px;
		height: 18px;
		margin: 0 16px 0 6px;
	}
	.SearchBar_SearchBar_close__SpKxI {
		/* display: none; */
		position: absolute;
		font-size: 12px;
		right: 0;
		top: 0;
		width: 50px;
		height: 50px;
		color: #999;
		padding: 15px;
	}
	.Result_className__wK_ah {
		position: fixed;
		left: 0;
		right: 0;
		background-color: #fff;
		.container {
			position: relative;
			margin: 0 auto;
			padding: 50px 0 0;
			max-width: 1060px;
			::before {
				content: ' ';
				display: table;
			}
			::after {
				clear: both;
			}
		}
		.RecentSearchResults_searchLabelClass__l5R6_ {
			display: inline-block;
			font-size: 14px;
			line-height: 20px;
			font-weight: 600;
			color: #333;
		}
	}
	.RecentSearchResults_rightSideButton__6OgA6 {
		float: right;
		font-size: 14px;
		font-weight: 400;
		line-height: 20px;
		color: #767676 !important;
		> svg {
			margin-left: 3px;
		}
	}
	.RecentSearchResults_listClass__3KCcZ {
		padding: 20px 0 50px;
		> .tagListItem {
			float: left;
			width: auto;
		}
	}
	font-family: inherit;
`;
export default SearchBar;
